import React from "react";

export default function () {
  return (
    <div className="flex bg-white">
      <div className="flex flex-col  items-center w-auto mt-4">
        <strong className="text-xl">Our Milestones</strong>
        <h1 className="mt-3">
          Our dream in to create an equal and barrier free world with the power
          of marks
          <h1 className="flex justify-center">
            every prodect and service technology
          </h1>
        </h1>
      </div>
    </div>
  );
}
